import React from 'react'

const BusinessPage = () => {
  return (
    <html className='bg-[#101010]'>
        <body>
            <main className='max-w-4xl'>
                <div className='my-11'>
                    <BusinessCard />
                </div>
                <div>
                    {/* <Overview/> */}
                    {/* <Projects/> */}
                </div>
            </main>
        </body>
    </html>
  )
}

export default BusinessPage


const BusinessCard = () => {
    return (
        <section className='bg-[#212121]'>
            <div className='text-white'>
                <div className='bg-[#F9DD76] h-11'></div>
            </div>
        </section>
    )
}
